import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; 
import { useHistory } from 'react-router';

import AdminDashboard from './Components/AdminDashboard/AdminDashboard';
import ProtectedRoute from './Components/Route/ProtectedRoute';
import ProductList from './Components/Product/ViewProducts/ProductList';
import Login from './Components/Login/Login';
import Register from './Components/Register/Register';
import React from 'react';
import { useState } from 'react';
import { useEffect } from 'react';
import Axios from 'axios';


function App() {

  let history = useHistory();

  const [Auth, setIsTrue] = useState(false)

  // useEffect( async () => {
  //   let result = await Axios.get("http://localhost:3001/isUserAuth", 
  //   {headers: {"x-access-token": localStorage.getItem("token")}});

  //   console.log(result.data)
  //   setIsTrue(result.data)
  // },[])


  return (
    <Router>
      <Switch>
      <React.Fragment>
        <Route exact path="/login">
          <Login/>
        </Route>
        <Route exact path={["/register"]}>
          <Register/>
        </Route>
        <Route exact path={["/", "/baligya"]}>
          <ProductList/>
        </Route>

        {/* <ProtectedRoute path="/dashboard" component={AdminDashboard} isAuth={Auth}/> */}

      </React.Fragment>
      </Switch>
    </Router>
  );
}

export default App;
